(async function (Scratch) {
    "use strict";
    const { GoogleGenAI } = await import("https://cdn.jsdelivr.net/npm/@google/genai@1.33.0/+esm")
    let ai = new GoogleGenAI({apiKey: ""});
    let instruction = "";
    let key = "No API key has been set.";
    let modelChoice = "gemini-2.5-flash";
    const menuIconURI = "data:image/svg+xml;base64,";
    const blockIconURI = "data:image/svg+xml;base64,";
    class TopazExt {
        constructor() { }
        getInfo() {
            return {
                id: "topaz",
                name: Scratch.translate("Topaz"),
                color1: "#ff904b",
                menuIconURI,
                blockIconURI,
                blocks: [
                    {
                        opcode: "generate",
                        blockType: Scratch.BlockType.REPORTER,
                        text: Scratch.translate(
                            "generate from [contents] and temperature of [temp]"
                        ),
                        arguments: {
                            contents: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "Tell me about Gemini.",
                            },
                            temp: {
                                type: Scratch.ArgumentType.NUMBER,
                                defaultValue: 1,
                            },
                        },
                    },
                    {
                        opcode: "getKey",
                        blockType: Scratch.BlockType.REPORTER,
                        text: Scratch.translate(
                            "current API key"
                        ),
                    },
                    {
                        opcode: "getModel",
                        blockType: Scratch.BlockType.REPORTER,
                        text: Scratch.translate(
                            "selected model"
                        ),
                    },
                    {
                        opcode: "setKey",
                        blockType: Scratch.BlockType.COMMAND,
                        text: Scratch.translate("set API key to [key]"),
                        arguments: {
                            key: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "",
                            },
                        },
                    },
                    {
                        opcode: "setInstruction",
                        blockType: Scratch.BlockType.COMMAND,
                        text: Scratch.translate({
                            default: "set personality to [personality]",
                        }),
                        arguments: {
                            personality: {
                                type: Scratch.ArgumentType.STRING,
                                defaultValue: "",
                            },
                        },
                    },
                    {
                        opcode: "setModel",
                        blockType: Scratch.BlockType.COMMAND,
                        text: Scratch.translate({
                            default: "use model [model]",
                        }),
                        arguments: {
                            model: {
                                type: Scratch.ArgumentType.STRING,
                                menu: "models",
                            },
                        },
                    },
                ],
                menus: {
                    models: [
                        "gemini-2.5-flash-lite", "gemini-2.5-flash", "gemini-2.5-pro", "gemini-3-flash-preview", "gemini-3-pro-preview", "gemini-3-deep-think"
                    ]
                },
            };
        }
        async generate(args) {
            const response = await ai.models.generateContent({
                model: modelChoice,
                contents: args.contents,
                config: {
                    systemInstruction: instruction,
                    temperature: args.temp,
                },
            });
            return response.text;
        }
        setKey(args) {
            key = args.key;
            ai = new GoogleGenAI({ apiKey: args.key });
        }
        setInstruction(args) {
            instruction = args.personality;
        }
        setModel(args) {
            modelChoice = args.model;
        }
        getKey(args) {
            return key;
        }
        getModel(args) {
            return modelChoice;
        }
    }
    Scratch.extensions.register(new TopazExt());
})(Scratch);
